export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},ZxoPRv8OnX:{data:{id:17,attributes:{imdbId:"tt1272878",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTQ5MTgzNDg4OF5BMl5BanBnXkFtZTcwMjAyODEzOQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"65%"},{Source:"Metacritic",Value:"55\u002F100"}],item_lang:{data:{id:680,attributes:{title:"2 Guns",plot:"Robert Trench, an undercover DEA agent, takes advantage of gunman Michael Stigman's idea to rob a bank to bust him and a mob boss. However, it proves too successful with much more money seized than anticipated with Trench's forces not stopping the getaway. Complicating things still more, Stigman turns out to be a Naval Intelligence agent who shoots Trench and takes the money. The interservice debacle suddenly finds Trench and Stigman in a bloody web of corrupt clandestine rivalries as they are hunted, blackmailed and isolated for the money on both sides of the law. Now, the fugitives must work together to find a way out of this situation with no one to turn to but themselves.",slug:"2-guns"}}},books:{data:[{id:1794,attributes:{title:"Marvel Two-In-One Masterworks",description:"Collects Marvel Two-In-One (1974) #47-60, Annual (1976) #4. Benjamin J. Grimm — the world’s one and only Ever-Lovin’ Blue-Eyed Thing — doesn’t shy away from any fight. And in this Marvel Masterworks edition, he’ll have to plow through the Machinesmith, the hated Yancy Street Gang, Graviton, Crossfire and even his younger self! But he’s not fighting alone: The Thing will battle alongside Jack of Hearts, Doctor Strange, the Inhumans, Moon Knight and the Human Torch — as well as the Marvel Universe’s greatest poker club! But all this action is just a prelude to Gruenwald, Macchio, Byrne and Pérez’s all-time classic: the PROJECT PEGASUS SAGA! The Project is part advanced energy research facility and part super villain prison — and that makes for one dangerous (and exciting!) combination when the inmates break out! Plus: Don’t miss the incorrigible Impossible Man’s attack on the Marvel Bullpen!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vyT8DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Allyn Brodsky",h,i,"Jo Duffy","John Byrne",j,"Marv Wolfman","Peter B. Gillis","Ralph Macchio",b],firstBook:true,published:"2020-11-18",publisher:e,subtitle:a}},{id:1795,attributes:{title:"2 Guns (Second Shot Deluxe Edition)",description:"Trench is a deep-cover DEA agent. Steadman is an undercover Naval Intelligence officer. Both think the other is a simple gun-for- hire, the perfect accomplice to help steal a bank vault full of mob money for the good guys. And neither realizes that their caper is a gigantic double-cross from the mob, who's just tricked both men into stealing $50 million from the CIA! Now Trench and Steadman race headlong across the Southwest, guns blazing, desperately outrunning Feds and mobsters alike while scrambling madly to find some way of clearing both their names before they're carved on tombstones!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ShhmDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2013-07-31",publisher:"Boom! Studios",subtitle:a}},{id:1796,attributes:{title:"Dazzler Masterworks",description:"Collects Dazzler (1981) #14-25, material from What If (1977) #33. Dazzler stormed to the top of the charts with her debut! Now she’s back with more sights and sounds from the early ’80s! The Women of Marvel join together as She-Hulk and Spider-Woman stand by the Dazzler’s side to fight the good fight — but soon the X-Men’s Angel flies into Dazzler’s life, sweeping her off her feet and into the air. Can romance bloom between two of Marvel’s most exciting mutants? But love will have to take a backseat when the Sisterhood of Evil Mutants show up to put Dazzler in her place: Mystique, Destiny and — in some of her earliest key appearances — Rogue! All this, plus appearances by the Fantastic Four, Power Man and Iron Fist, and a WHAT IF? rarity!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=oNEQEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Danny Fingeroth",b],firstBook:d,published:"2021-03-24",publisher:e,subtitle:a}},{id:1797,attributes:{title:"Black Jackets",description:"A hardened team of imprisoned ex-cops -- each guilty of a different felony -- is offered a last chance at redemption in exchange for joining a clandestine strike force tasked with taking down an untouchable, corrupt sheriff. Following foot soldiers whose hands may be dirtier than the criminals they track down, Black Jackets is an edge-of-your seat ride through a duplicity-filled underworld in an elusive search for justice -- with a healthy dose of bullets, blood and sex along the way. Brought to you by Steven Grant (Punisher, Whisper, 2 Guns), Shane Riches (ha.i.ley) and Jesús Antonio Hernández Portaveritas (His Name Is... Savage!)",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QOKczQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b,"Shane Riches"],firstBook:d,published:"2020-08-05",publisher:a,subtitle:a}},{id:1798,attributes:{title:"Avengers Masterworks Vol. 18",description:"Collects Avengers (1963) #178-188, Annual (1967) #8-9, Marvel Premiere (1972) #49 and material from Marvel Tales (1966) #100. Avengers Mansion is running out of room, so the old order changeth! Government agent Henry Peter Gyrich is kicking out all but seven Avengers. Despite their protests, the team wont have time to argue  because a mysterious man from Quicksilver and the Scarlet Witchs past has emerged, kicking off an adventure that leads the Avengers to Wundagore Mountain and reveals the answer to one of Marvels oldest mysteries! But first, the Absorbing Man shows up for a good ol fashioned knuckle-crunching battle! Also featuring a trip to the Inhumans Great Refuge, an all-new Doctor Spectrum in a story illustrated by George Pérez, solo Beast and Falcon adventures and the massive mountain-menace Monolith! Brought to you by Avengers greats David Michelinie and John Byrne!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WuFJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[i,h,"Tom Defalco","Steve Gerber",j,b,"Roger Slifer","Jim Shooter","Mark Evanier","Scott Edelman"],firstBook:d,published:"2018-04-11",publisher:e,subtitle:a}}]}}},meta:{}}},prerenderedAt:1682568341322}}("","Steven Grant","movie",null,"Marvel Entertainment","series",1,"Bill Mantlo","David Michelinie","Mark Gruenwald"))